# encoding: utf-8
# 縱橫碼
#
# 縱橫碼以漢字四角筆形編碼，依次序為左上、右上、左下、右下，如果一個漢字不是四碼則有幾碼取幾碼。
# 二字詞組，取碼原則是3+3規則，即取每個字的前三碼。
# 三字詞組，取碼原則是2+2+2規則，即取每個字的前二碼。
# 四字詞組，取碼原則是2+1+1+2規則，即取第一字的前二碼，第二、三字的前一碼，第四字的前二碼。
# 多字詞組，取碼原則是2+1+1+1+1規則，即取第一字的前二碼，第二、三、四、五字的前一碼，往後的字不取任何碼。
# 編碼又將常用字及詞定義了簡碼，一鍵簡碼、二鍵簡碼分別取各單字、詞組縱橫碼的前一、二碼

